import { Facebook, Instagram, MailOutline, Room, Phone,  Pinterest, Twitter } from "@material-ui/icons";
import styled from "styled-components"

const Container = styled.div`
   display: flex;

`;
const Left = styled.div`
   flex: 1;
   display: flex;
   flex-direction: column;
   padding: 10px;

`;
const Logo = styled.h1``;

const Desc = styled.p`
    margin: 20px 0px;

`;
const SocialContainer = styled.div`
    display: flex;

`;
const SocialIcon = styled.div`
    width: 40px;
    height: 40px;
    border-radius: 50%;
    color: white;
    background-color: #${props=>props.color};
    display: flex;
    align-items: center;
    justify-content: center;
    margin-right: 20px;

`;

const Center = styled.div`
   flex: 1;
   padding: 20px;

`;

const Title= styled.h3`
    margin-bottom: 30px;

`;


const List= styled.ul`
    margin: 0;
    padding: 0;
    list-style: none;
    display: flex;
    flex-wrap: wrap;
`;


const ListItem = styled.li`
    width: 50%;
    margin-bottom: 4%;

`;


const Right = styled.div`
   flex: 1;
   padding: 20px;

`;


const ContactItem = styled.div`
    margin-bottom: 20px;
    display: flex;
    align-items: center;

`;

const Payment = styled.img`
    width: 50%; 
`;

const Footer = () => {
  return (
    <Container>

        <Left>
            <Logo>
                <img src="/images/logo.png" alt="logo"/>
            </Logo>
            <Desc>

            It is a long established fact that a reader will be distracted by the 
            readable content of a page when looking at its layout. 
            The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, 
            as opposed to using 'Content here,

            </Desc>
            <SocialContainer>
                <SocialIcon color="3B5999">
                    <Facebook/>
                </SocialIcon>
                <SocialIcon color="E4405F">
                    <Instagram/>
                </SocialIcon>
                <SocialIcon color="55ACEE">
                    <Twitter/>
                </SocialIcon>
                <SocialIcon color="E60023">
                    <Pinterest/>
                </SocialIcon>


            </SocialContainer>
        </Left>
        <Center>
            <Title>Useful Links</Title>
            <List>
                <ListItem>Home</ListItem>
                <ListItem>Cart</ListItem>
                <ListItem>Man Fashion</ListItem>
                <ListItem>Woman Fashion</ListItem>
                <ListItem>jowlery</ListItem>
                <ListItem>My Account</ListItem>
                <ListItem>Order Tracking</ListItem>
                <ListItem>Wishlist</ListItem>
                <ListItem>Terms</ListItem>
            </List>
        </Center>
        <Right>

            <Title>Contact</Title>
            <ContactItem><Room style={{marginRight:"10px"}}/>kotebe Mesalemeya, Aroud Abem hotel</ContactItem>
            <ContactItem><Phone style={{marginRight:"10px"}}/>+251919174519</ContactItem>
            <ContactItem><MailOutline style={{marginRight:"10px"}}/>ETHIOHAB@gmail.com</ContactItem>
            <Payment src="https://www.pngmart.com/files/7/Payment-Background-PNG.png"/>

        </Right>

    </Container>
  )
}

export default Footer
